import HeaderVue from './HeaderVue'
import MaxInput from './MaxInput'
import MapPin from './MapPin.vue'


export default {
    install(app) {
        app.component(HeaderVue.name,HeaderVue)
        app.component("MaxInput".name,MaxInput)
        app.component("MapPin",MapPin)
    }
}
